import collections


class Solution:
    def lastSubstring1(self, s: str) -> str:
        re = ''
        checked = ''
        for sub in s[::-1]:
            checked = sub + checked
            if re < checked:
                re = checked
        return re

    def lastSubstring(self, s: str) -> str:
        re = ''
        for i in range(len(s)):
            if re < s[i:]:
                re = s[i:]
        return re

if __name__ == '__main__':
    print(Solution().lastSubstring(
        ""))
